import { Component, OnInit } from '@angular/core';
import { FormBuilder, FormGroup,  Validators } from '@angular/forms';
@Component({
  selector: 'app-signup',
  templateUrl: './signup.component.html',
  styleUrls: ['./signup.component.scss']
})
export class SignupComponent implements OnInit {
  signupForm: FormGroup | undefined
  constructor(private fb: FormBuilder,){

  }

  ngOnInit(): void {
    this.signupForm = this.fb.group({
      name: [null, Validators.required],
      email: [null, Validators.required, Validators.email],
      password:[null, Validators.required, Validators.maxLength(8)]
    })

  }



}
<div class="container-fluid">
    <h1 class="text-center">SignUp Form</h1>
    <form class="signup-form">
        <mat-form-field appearance="outline" class="pb-0">
          <!-- <mat-label>Name</mat-label> -->
          <input class="form-control" matInput formControlName="name" placeholder="Enter your name">       

        </mat-form-field>      
        <mat-form-field appearance="outline" class="pb-0">
          <!-- <mat-label>Email</mat-label> -->
          <input class="form-control" matInput formControlName="email" placeholder="Enter your email">         
        </mat-form-field>      
        <mat-form-field appearance="outline">
          <!-- <mat-label>Password</mat-label> -->
          <input class="form-control" matInput type="password" formControlName="password" placeholder="Enter your password">       
        </mat-form-field>
      <div class="signup-btn">
        <button class="btn btn-primary" type="submit">Sign Up</button>

      </div>
      </form>










</div>
